CREATE DATABASE Py;
USE Py;
CREATE TABLE Orders 
(
    order_id	VARCHAR(512),
    order_date	VARCHAR(512),
    ship_date	VARCHAR(512),
    ship_mode	VARCHAR(512),
    customer_id	VARCHAR(512),
    customer_name	VARCHAR(512),
    segment	VARCHAR(512),
    postal_code	INT,
    region	VARCHAR(512),
    product_id	VARCHAR(512),
    category	VARCHAR(512),
    sub_category	VARCHAR(512),
    product_name	VARCHAR(512),
    sales	DOUBLE,
    quantity	INT,
    discount	VARCHAR(512),
    profit	DOUBLE
);


SELECT * FROM Orders;

-- 1	Most profitable product region wise.
-- 2	Which city has most number of ordered product.
-- 3	State wise profits.
-- 4	State wise loss.
-- 5	Most loss making segment.
-- 6	Most ordered product in "Texas".
-- 7	How many product are ordered yearly.
-- 8	Least ordered product in "Colorado".
-- 9	Which sub category is performing well.
-- 10	Which month observe highest number of order placed.
 
-- 1	Most profitable product region wise.

SELECT * FROM Orders;

SELECT region,sum(case when profit>1 then profit end) as profit from Orders group by region;

-- SELECT a.country,a.city,a.state from Orders a 
-- INNER JOIN Location l ON o.postal_code=l.postal_code;

SELECT L.CITY,COUNT(O.order_id) 
FROM Orders O JOIN Location L ON O.POSTAL_CODE=L.POSTAL_CODE
GROUP BY L.CITY
ORDER BY L.CITY DESC LIMIT 1;

-- 2	Which city has most number of ordered product.
select city from Location
where city=(SELECT city from Orders o 
JOIN Location l on o.postal_code=l.postal_code
group by l.city
order by count(o.order_id) DESC
limit 1);


-- 3	State wise profits.
SELECT L.state, SUM(CASE WHEN profit > 1 THEN profit END) AS profit
FROM Orders O
JOIN Location L ON O.postal_code = L.postal_code
GROUP BY L.state
ORDER BY profit DESC;

-- 4)State wise loss.
SELECT L.state, SUM(CASE WHEN profit <1 THEN profit END) AS profit
FROM Orders O
JOIN Location L ON O.postal_code = L.postal_code
GROUP BY L.state
ORDER BY profit DESC;

-- 5	Most loss making segment.
select * from Orders;

SELECT segment,max(case when profit<1 then profit end) as LOSS from Orders
GROUP BY segment;


-- 6	Most ordered product in "Texas".
SELECT l.state,o.product_name from Orders o
JOIN Location l on l.postal_code=o.postal_code
where l.state like 'T%';

-- 7	How many product are ordered yearly.
select * from Orders;
select str_to_date(order_date,'%y-%m-%d') as order_date,product_name from Orders;

-- 8	Least ordered product in "Colorado".
with ct as (select a.product_name , a.quantity, b.state from Orders a join location b on a.postal_code = b.postal_code where b.state = 'Colorado')
select product_name, sum(quantity) as ordered from ct group by product_name order by sum(quantity) asc limit 1;
-- 9	Which sub category is performing well.
with ct as (select sub_category, sum(sales) as sales , sum(quantity) as qun , sum(profit) as profit from Orders  group by sub_category)
select sub_category, sales, profit from ct order by  profit desc limit 1;


-- 10	Which month observe highest number of order placed

with ct as (select substring(order_date, 4,2) as months, (order_id)  from Orders)
select (
case when months = '01' then 'jan' 
when months  = '02' then 'feb' 
when months ='03' then 'mar'
when months = '04' then 'apr'
when months = '05' then 'may'
when months = '06' then 'jun'
when months = '07' then 'july'
when months = '08' then 'aug'
when months = '09' then 'sept'
when months = '10' then 'oct'
when months = '11' then 'nov'
when months = '12' then 'dec'

else 'not the list'





end) as months , count(order_id) as ordered from ct group by months order by count(order_id) desc  limit 1;
 


